import React, { useState } from 'react';

const Login = ({ onNavigate }) => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [submitting, setSubmitting] = useState(false);

  const submit = (e) => {
    e.preventDefault();
    setSubmitting(true);
    setTimeout(() => {
      setSubmitting(false);
      onNavigate('home');
    }, 700);
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-6 py-12">
      <div className="relative max-w-6xl w-full grid grid-cols-1 lg:grid-cols-2 gap-8 items-center">

        {/* Left hero for visual parity with Register */}
        <div className="rounded-3xl p-10 overflow-hidden relative bg-gradient-to-br from-indigo-600 via-purple-600 to-pink-500 text-white shadow-2xl">
          <div className="absolute -left-20 -top-12 w-64 h-64 bg-white/10 rounded-full blur-3xl animate-pulse" />
          <div className="absolute right-0 bottom-0 w-48 h-48 bg-white/6 rounded-full blur-2xl" />

          <h1 className="text-4xl font-extrabold mb-4">Welcome back üëã</h1>
          <p className="text-lg opacity-90 mb-6">Sign in to continue using the EmotionLab dashboard and real-time detection.</p>

          <div className="grid grid-cols-1 gap-4">
            <div className="flex items-start gap-3">
              <div className="w-10 h-10 rounded-lg bg-white/20 flex items-center justify-center">‚ö°</div>
              <div>
                <h4 className="font-semibold">Instant feedback</h4>
                <p className="text-sm opacity-80">Get immediate emotion suggestions</p>
              </div>
            </div>

            <div className="flex items-start gap-3">
              <div className="w-10 h-10 rounded-lg bg-white/20 flex items-center justify-center">üîê</div>
              <div>
                <h4 className="font-semibold">Secure by design</h4>
                <p className="text-sm opacity-80">We respect privacy and consent</p>
              </div>
            </div>
          </div>
        </div>

        {/* Right: compact login form */}
        <div className="bg-white/5 backdrop-blur-sm p-10 rounded-2xl shadow-xl border">
          <h2 className="text-3xl font-bold mb-4">Sign in</h2>
          <p className="mb-6 opacity-90">Access live detection and personalized suggestions.</p>

          <form onSubmit={submit} className="space-y-4">
            <div>
              <label className="block text-sm mb-1">Email</label>
              <input value={email} onChange={e => setEmail(e.target.value)} placeholder="you@domain.com" type="email" className="w-full p-3 rounded-lg border bg-transparent focus:ring-4 focus:ring-indigo-300" required />
            </div>

            <div>
              <label className="block text-sm mb-1">Password</label>
              <input value={password} onChange={e => setPassword(e.target.value)} placeholder="Your password" type="password" className="w-full p-3 rounded-lg border bg-transparent focus:ring-4 focus:ring-pink-300" required />
            </div>

            <div className="flex items-center gap-3 mt-3">
              <button type="submit" disabled={submitting} className="px-6 py-3 rounded-lg bg-gradient-to-r from-indigo-500 to-purple-500 text-white font-medium shadow transform transition hover:-translate-y-0.5">
                {submitting ? (
                  <span className="inline-flex items-center gap-2"><svg className="w-4 h-4 animate-spin" viewBox="0 0 24 24"><circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4" fill="none" /><path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v8z" /></svg> Signing in...</span>
                ) : 'Sign in'}
              </button>

              <button type="button" onClick={() => onNavigate('register')} className="px-4 py-3 rounded-lg border hover:bg-white/5">Create account</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Login;
